import React from 'react';
import FeatureBox from './FeatureBox';
import featureimage from  '../../Assets/images/home/feature_1.png';
import featureimage1 from '../../Assets/images/home/feature_2.png';
import featureimage2 from '../../Assets/images/home/feature_3.png';
import './styles.css';



function Feature() {
  return (
    <div id='features'>
        <div className='a-container'>
            <FeatureBox image={featureimage} title='Password Generator' />
            <FeatureBox image={featureimage1} title='Encryption' />
            <FeatureBox image={featureimage2} title='Multi-platform support
' />
        </div>
    </div>
  )
}

export default Feature;
